import React from 'react';

function WatchList() {
  const FixedHeightContainer={
 
  height: "404px",
  width:"333%", 
  padding:"1px",
  
  border:"1px solid black"

}
const Content=
{
  height:"87%",
   overflow:"auto",
    background:"#fff"
}
  return (
    <>
    <div className="col-md-3">
   
    <div className="FixedHeightContainer" style={FixedHeightContainer}>
    
        <div className="Content scroable" style={Content}>
        <ul className="list-group my-2">
        <li className="list-group-item my-2">An item</li>
      </ul>
      <ul className="list-group">
        <li className="list-group-item my-2">An item</li>
      </ul>
      <ul className="list-group">
        <li className="list-group-item my-2">An item</li>
      </ul>
      <ul className="list-group">
        <li className="list-group-item my-2">An item</li>
      </ul>
        </div>
      </div>
  

    </div>
    </>
    );
}

export default WatchList;
